%[text] %[text:anchor:T_856553D9] # **Cylinder Chart Examples**
%[text] %[text:anchor:H_5247FA2F] **Overview**
%[text] The `CylinderChart` creates three-dimensional stacked cylinders, similar to a stacked bar graph. The chart data comprises a nonnegative numeric 2-D matrix (`Data`). The number of stacks is equal to the number of rows of `Data`, and each stack is positioned on the $x$-axis of the chart. The number of cylinders within each stack is equal to the number of columns of `Data`. The heights of the cylinders within each stack correspond to the values contained in each row of `Data`.
%[text] ![CylinderChart.png](text:image:4a32)
%[text] **Documentation**
%[text] - [`cylinder`](<matlab: doc( "cylinder" )>): Create $x$, $y$ and $z$-coordinates for a cylinder
%[text] - [`surface`](<matlab: doc("surface")>): Primitive surface plot \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_AA2992B7] ## Create sample chart data.
%[text] The data in each row corresponds to a single stack, and the data in each column corresponds to the heights of the individual cylinders within the stack.
Y = [2, 2, 3;
    2, 5, 6;
    2, 8, 9;
    2, 11, 12];
%%
%[text] %[text:anchor:H_667F159A] ## Create a figure for the chart.
f = exampleFigure( "Name", "CylinderChart Example" ); %[output:2d56b6a9]
%%
%[text] %[text:anchor:H_4B7C58CC] ## Create the chart, specifying the parent and input data.
CC = CylinderChart( "Parent", f, "Data", Y ); %[output:2d56b6a9]
%%
%[text] %[text:anchor:H_3590D11B] ## Annotate the chart.
xlabel( CC, "Stacks", "FontSize", 14 ) %[output:72e0c9ac]
zlabel( CC, "Values", "FontSize", 14 ) %[output:72e0c9ac]
title( CC, "Cylinder Chart", "FontSize", 14 ) %[output:72e0c9ac]
xticklabels( CC, ["A", "B", "C", "D"] ) %[output:72e0c9ac]
%%
%[text] %[text:anchor:H_0DCC6BD3] ## Change the cylinder face colors.
CC.FaceColors = copper( 3 ); %[output:62e0c985]
%%
%[text] %[text:anchor:H_1CF1052C] ## Truncate the current chart data by removing a stack.
CC.Data = CC.Data(1:3, :); %[output:539231bf]
%%
%[text] %[text:anchor:H_081E52C4] ## Extend the current chart data by creating multiple stacks.
CC.Data = [CC.Data; CC.Data]; %[output:3a207d28]
%%
%[text] %[text:anchor:H_E04FF5BC] ## Change the data by increasing the number of layers.
CC.Data = [ones( height( CC.Data ), 1 ), CC.Data]; %[output:562bd29c]
%%
%[text] %[text:anchor:H_55775344] ## Modify the axis tick labels and truncate the chart data.
xticklabels( CC, ["X", "Y", "Z", "A", "B", "C"] ) %[output:4481ff8f]
CC.Data = CC.Data(1:end-1, :); %[output:4481ff8f]
%%
%[text] %[text:anchor:H_D251B596] ## Remove the top layer of chart data.
CC.Data = CC.Data(:, 1:end-1); %[output:5c53d1c3]
%%
%[text] %[text:anchor:H_BA48DDE4] ## Change the chart view and face colors.
set( CC, "View", [-14, 12], "FaceColors", hsv( 3 ) ) %[output:67414b71]
%%
